import "./App.css";
import AddVideo from "./component/AddVideo";
import ShowingVideos from "./component/ShowingVideos";
import videos from "./Data/exampleresponse.json";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Video Recommendation</h1>
      </header>
      <div>
        <ShowingVideos result={videos} />
        <AddVideo />
      </div>
    </div>
  );
}

export default App;
